import React from 'react';
import Subgenre from './Subgenre/Subgenre';

const SubgenreList = ({ subgenres }) => {
    console.log('subs', subgenres);
    return (
        <div className="podcast-container">
            {
                Object.keys(subgenres).forEach(key => {
                    console.log(subgenres[key])
                })
            }
        </div>
    )    
}

export default SubgenreList;
